create table t_permission
(
  id          varchar(255) not null
    constraint t_permission_pkey
      primary key,
  create_by   varchar(255)   default NULL::character varying,
  create_time timestamp,
  del_flag    integer,
  update_by   varchar(255)   default NULL::character varying,
  update_time timestamp,
  description varchar(255)   default NULL::character varying,
  name        varchar(255)   default NULL::character varying,
  parent_id   varchar(255)   default NULL::character varying,
  type        integer,
  sort_order  numeric(10, 2) default NULL::numeric,
  component   varchar(255)   default NULL::character varying,
  path        varchar(255)   default NULL::character varying,
  title       varchar(255)   default NULL::character varying,
  icon        varchar(255)   default NULL::character varying,
  level       integer,
  button_type varchar(255)   default NULL::character varying,
  status      integer,
  url         varchar(255)   default NULL::character varying,
  show_always boolean        default true
);

alter table t_permission
  owner to postgres;

